import React, { Component } from 'react';
import './Cart.css';

class Cart extends Component {
  render() {
    const roll = this.props.latestRoll;
    console.log("roll", roll);
    return (
        <div className={this.props.className}>
          <p>Shopping Cart ({this.props.itemCount} items)</p>
          {this.props.cart.map((roll) => console.log("added!", roll.name))}
          <p>HELLLOOOOOO</p>
        </div>

    );
  }
}

export default Cart;
